import React from "react";
import styled,{css} from "styled-components";
import { ChampionTrendItemCss } from "./ChampionTrendToolbar";


const ChampionTrendHeader=styled.div`
    
    padding:15px;
    &>div{
        flex:1;
        font-size:12px;
        &:nth-child(1){
            flex:.1;
        }
        &:nth-child(2){
            flex:3;
        }
    }
`

export default ChampionTrendHeader;
